import React from "react";
import { FaEdit, FaTrashAlt } from "react-icons/fa";

const TablaCocheras = () => {
    const cocheras = [
        { id: "C101", numero: "101", ubicacion: "Subterráneo-Edificio A", estado: "Disponible", asignada: "-" },
        { id: "C102", numero: "102", ubicacion: "Subterráneo-Edificio A", estado: "Ocupada", asignada: "Juan Pérez" },
        { id: "C103", numero: "103", ubicacion: "Subterráneo-Edificio A", estado: "Disponible", asignada: "-" },
    ];

    return (
        <div className="table-responsive">
            <table className="table table-striped table-bordered">
                <thead className="table-primary">
                <tr>
                    <th>ID Cochera</th>
                    <th>Número de Cochera</th>
                    <th>Ubicación</th>
                    <th>Estado</th>
                    <th>Asignada a</th>
                    <th>Acciones</th>
                </tr>
                </thead>
                <tbody>
                {cocheras.map((cochera) => (
                    <tr key={cochera.id}>
                        <td>{cochera.id}</td>
                        <td>{cochera.numero}</td>
                        <td>{cochera.ubicacion}</td>
                        <td>
                                <span
                                    className={`badge ${
                                        cochera.estado === "Disponible"
                                            ? "bg-success"
                                            : "bg-danger"
                                    }`}
                                >
                                    {cochera.estado}
                                </span>
                        </td>
                        <td>{cochera.asignada}</td>
                        <td>
                            <button className="btn btn-sm btn-outline-primary me-2">
                                <FaEdit />
                            </button>
                            <button className="btn btn-sm btn-outline-danger">
                                <FaTrashAlt />
                            </button>
                        </td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default TablaCocheras;
